#include <stdio.h>
#include <stdlib.h>
#include <string.h>

int compare(const void *a, const void *b) {
    return (*(char *)a - *(char *)b);
}

int sortDigits(int n) {
    // Convert the integer to a string to manipulate its digits
    char str[20];
    sprintf(str, "%d", n);

    // Sort the digits in ascending order
    qsort(str, strlen(str), sizeof(char), compare);

    // Convert the sorted string back to an integer
    return atoi(str);
}

void bubbleSort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Swap arr[j] and arr[j+1]
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}
int mostFrequent(int arr[], int n) {
    int max_count = 1;  // Stores maximum frequency
    int res = arr[0];   // Result to be returned, initialized with first element
    int curr_count = 1; // Stores current frequency

    // Traverse the sorted array
    for (int i = 1; i < n; i++) {
        // If current element is same as previous
        if (arr[i] == arr[i - 1])
            curr_count++;
        else {
            // If frequency of previous element is more than max_count
            if (curr_count > max_count) {
                max_count = curr_count;
                res = arr[i - 1];
            }
            curr_count = 1; // Reset count for new element
        }
    }

    // If last element is most frequent
    if (curr_count > max_count)
    {
        max_count = curr_count;
        res = arr[n - 1];
    }

    return res;
}


